        private static List<Tuple<DateTime, double>> AnalyserMois(string  periodData)
        {
            List<Tuple<DateTime, double>> priceList = new List<Tuple<DateTime, double>>();

            ConsumptionData? consumptionData = JsonConvert.DeserializeObject<ConsumptionData>(periodData);

            foreach(Consumption consumption in consumptionData.Consumptions)
            {
                DateTime dt = consumption.Period.StartTime;
